angular.module("angular-select").run(["$templateCache", function($templateCache) {$templateCache.put("active.html","<div style=\"padding: 6 12 6 12;\">\n	<span ng-show=\"current.text\" style=\"font-size: 11px\">{{current.text}}</span>\n	{{current.name}}\n</div>");
$templateCache.put("arrow.html","<span id=\"arrow\" style=\"padding-right: 10\">\n	<span ng-show=\"active\"><i class=\"glyphicon glyphicon-chevron-up\"> </i></span>\n	<span ng-show=\"!active\"><i class=\"glyphicon glyphicon-chevron-down\"> </i></span>\n</span>\n");
$templateCache.put("disabled.html","<div style=\"margin-bottom: 6 \">\n	{{current.text}}\n</div>");
$templateCache.put("empty.html","<div>\n	<i>{{placeholder}}</i>\n</div>");
$templateCache.put("inactive.html","<div width=\"100%\">\n	<div style=\"padding: 6 12 6 12;\">\n		<span ng-show=\"current.text\" style=\"font-size: 11px\">{{current.text}}</span>\n		{{current.name}}\n	</div>\n	<div style=\"position:absolute; right: 0px; top: 0px; padding-left: 10px; background: white; padding: 6px; box-shadow: 0px 0px 20px 10px rgba(255,255,255,1);\" class=\"icons\">\n	</div>\n</div>");
$templateCache.put("list.html","<div style=\"padding-bottom: 15px\">\n	<table class=\"table table-compact table-hover\" style=\"margin-bottom: 0; margin-top: 10px\">\n		<tr ng-repeat=\"r in results\" style=\"border-width: 0px; padding: 0px\">\n			<td  style=\"border-width: 0px;\" ng-click=\"select(r.id)\">	\n				<span ng-show=\"r.text\" style=\"font-size: 11px; max-width: 70%; text-overflow: ellipsis;\">{{r.text}}<br></span>\n				<span ng-show=\"r.displayname && r.name!=r.displayname\">\n					{{r.displayname}} ({{r.name}}) \n				</span>\n				<span ng-show=\"r.name==r.displayname\">\n					{{r.displayname}} \n				</span>\n			</td>\n		</tr> \n	</table>\n	<small ng-show=\"hasMore\" style=\"margin: 10; margin-bottom: 40; padding-top: 10px; padding-bottom: 10px\">\n		<i>more results found - use filtering</i>\n	</small>\n	<small ng-show=\"results.length==0\" style=\"margin: 10; margin-bottom: 40; padding-top: 10px; padding-bottom: 10px\">\n		<i>no results</i>\n	</small>\n</div>");
$templateCache.put("overlay.html","<div class=\"well well-sm\" style=\"padding-left: 9x; margin: 0px; padding: 6 12 6 12;\">\n\n</div>");
$templateCache.put("query.html","<div>\n	<input class=\"form-control\" ng-model=\"search\" ng-change=\"runQuery()\">\n</div>");
$templateCache.put("remove.html","<span id=\"remove\"  style=\"padding-right: 10\">\n	<span><i class=\"glyphicon glyphicon-remove\"> </i></span>\n</span>\n");}]);